ices']['dashboard']:\n                break\n                \n            print(f\"\u26a0\ufe0f Scheduler not ready, retrying... ({retries + 1}/{max_retries})\")\n            client.close()\n            \n        except Exception as e:\n            print(f\"\u26a0\ufe0f Error initializing Dask client: {str(e)}\")\n            time.sleep(1)  # Wait before retry\n            \n        retries += 1\n    \n    if client is None or not client.scheduler_info():\n        raise RuntimeError(\"Failed to initialize Dask client after multiple attempts.\")\n        \n    timings = []\n    all_task_stream = []\n\n    try:\n        with performance_report(filename=\"dask-report.html\"):\n            for idN, filename in enumerate(filelist):\n                print(f\"\\n\ud83d\udcc1 Processing file {filename}...\")\n                start_time = time.time()\n\n                \n\n                df = process_dask(root_file_path=filename, idN=idN)\n                task_stream = capture_task_stream(client)\n\n                all_task_stream.extend(task_stream)\n\n                # Ensure columns in column_order\n                for col in column_order:\n                    if col not in df.columns:\n                        df[col] = -99\n                df = df[column_order].fillna(-99)\n                df_filtered = filter_data(df)\n\n                output_csv = \"row.csv\"\n                output_hdf = \"row.h5\"\n                header = (idN == 0)\n                mode = 'w' if idN == 0 else 'a'\n\n                df_filtered.to_csv(output_csv, index=False, header=header, mode=mode)\n                with warnings.catch_warnings():\n                    warnings.simplefilter(action='ignore', category=pd.errors.PerformanceWarning)\n                    df.to_hdf(output_hdf, key='df', mode=mode)\n\n                duration = time.time() - start_time\n                timings.append((filename, duration))\n                print(f\"\u2705 Saved rows (file time: {duration:.2f} s)\")\n\n    finally:\n        client.close()\n\n    plot_task_timeline(all_task_stream)\n\n    filenames, durations = zip(*timings)\n    plt.figure(figsize=(8, 5))\n    plt.barh(filenames, durations, color='skyblue')\n    plt.xlabel(\"Processing Time (s)\")\n    plt.title(\"ROOT File Processing Time\")\n    plt.tight_layout()\n    plt.savefig(\"processing_times.png\")\n    plt.show()\n\n    print(\"\ud83d\udfe2 All files processed. Performance report saved as `dask-report.html`.\")\n\n        &lt;/pre&gt;\n        "}}}},{"type":"object","name":"TabPanel","id":"p49855","attributes":{"title":"Task Stream","child":{"type":"object","name":"Figure","id":"p49293","attributes":{"name":"task_stream","sizing_mode":"stretch_both","x_range":{"type":"object","name":"DataRange1d","id":"p49291","attributes":{"range_padding":0}},"y_range":{"type":"object","name":"DataRange1d","id":"p49292","attributes":{"range_padding":0}},"x_scale":{"type":"object","name":"LinearScale","id":"p49305"},"y_scale":{"type":"object","name":"LinearScale","id":"p49307"},"title":{"type":"object","name":"Title","id":"p49296","attributes":{"text":"Task Stream"}},"renderers":[{"type":"object","name":"GlyphRenderer","id":"p49366","attributes":{"data_source":{"type":"object","name":"ColumnDataSource","id":"p49288","attributes":{"selected":{"type":"object","name":"Selection","id":"p49289","attributes":{"indices":[],"line_indices":[]}},"selection_policy":{"type":"object","name":"UnionRenderers","id":"p49290"},"data":{"type":"map","entries":[["start",[1747407164346.4578,1747407164397.9697,1747407164556.8442,1747407164563.4304,1747407164812.6064,1747407164872.7512,1747407165093.541,1747407165095.1692,1747407165295.6672,1747407165320.7842,1747407165520.9001,1747407165561.135,1747407166034.2144,1747407166077.3496,1747407166291.4683,1747407166318.7102,1747407166644.5908,1747407166685.1638,1747407166934.2507,1747407166971.495,1747407167294.586,1747407167334.1328,1747407167566.3672,1747407167603.0425,1747407168179.8816,17474071
